function sendReportString(string, size){
    var packet= [];
    var data = string.split(' ');
    
    for(let i = 0; i < data.length; i++){
        packet[parseInt(i,16)] =parseInt(data[i],16)//.toString(16)
    }

    device.send_report(packet, size);
}

export function Shutdown()
{
    sendColors(true);
}

export function Validate(endpoint)
{

    return endpoint.interface === 3// && endpoint.usage === 2 //&& endpoint.usage_page == 0x000c;
}

function StartPacket(){
    sendReportString("00 04 F2",65)
}
function sendColors(shutdown = false){
    StartPacket();
    var packet = []
    packet[0x00]   = 0x00;

    packet[0x01] = 0x81;

         var iPxX = vLedPositions[0][0];
         var iPxY = vLedPositions[0][1];
         var color;
         if(shutdown){
             color = hexToRgb(shutdownColor)
         }else if (LightingMode == "Forced") {
             color = hexToRgb(forcedColor)
         }else{
             color = device.color(iPxX, iPxY);
         }
        packet[0x02]= color[0];
        packet[0x03] = color[1];
        packet[0x04] = color[2];
    packet[9] = 0x02;
    device.send_report(packet,65)

}
export function Render() {
    sendColors();
    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
    }
}

